import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <h2>Jade and Seka Wedding Website</h2>
      <input placeholder='Please enter your Full Name to access the site'></input>
      <button>Submit</button>
    </div>
  );
}

export default App;
